(421, '', 'Australian Lamb Leg', '42.00 AED /KG', '', 'Australia', '[]', 'Eating Lamb meat can cause allergic reactions ranging from mild to severe attacks affecting the skin, respiratory tract, gastrointestinal tract and cardiovascular system.  Allergies to Lamb meat may also include allergies to other meats like beef and poultry.  Know your allergic tendencies and avoid consumption at once, if adverse body reaction is observed.  Consult a doctor for possible medication, management and treatment.', '[\"-q9B10LVQVG1w05Jf2nr3Y5leKxcmwZkyEm6yRq9IEw22UHJc7iU_qDqR4orAXTY9Yu07tEKVQQeY4qv9-UbJeebiNYC9gFPwYrH.jpg\", \"Dv7Wf9QnuD5yLGBtomkgZBnRXmcUsllZgf0o9nX3GSzmjtXuqx5KCwJ_JnCxPfjo7oAJyza1ZWkLOPUK3TkZ40uG1IT1A7ATo8QH.jpg\"]', '[\"Fresh Food\", \"Meat & Poultry\", \"Lamb\", \"Australian Lamb\"]'),
