(1065, '', 'Fresh Shrimps 40/60', '44.95 AED /KG', '', 'India', '[]', 'Shrimp allergy triggered by consumption of shrimps, or food containing even traces of it, can have mild to severe reactions involving Itching sensation in the mouth, abdominal pain, nausea, diarrhea or vomiting, lightheadedness, dizziness or fainting.  Know your allergic tendencies and avoid consumption at once, if adverse body reaction is observed.  Consult a doctor for possible medication, management and treatment.', '[\"GVI93v-Ve_8il7PZ78xC_oFw29a7uvSvNJhHGqGypLcMaqKsmHPQ525we8UtdF68bajQy82gZ2ASZrvtnFU7xCpI0TP1K5WfUAl7.jpg\"]', '[\"Fresh Food\", \"Fish & Seafood\", \"Seafood\", \"Fresh Shrimp\"]'),
